const decode=n=>{const r=[0,9,10,13,34,0,38,92],e=n.length;let t=e;for(let f=0;f<e-1;f++)n.charCodeAt(f)>=128&&t++;const o=(7*t/8>>0)+(t%8==0?0:1),c=new Uint8Array(o);let i=0,a=0,h=7,l=0;for(let f=0;f<e;f++){let e=n.charCodeAt(f);if(0==l){if(e>=128){const n=e>>7;10==n?e&=127:(e=r[n-1],f--,l=1)}}else e&=127,l=0;for(let t=6;t>=0;t--)a|=(e>>t&1)<<h,0==h?(c[i++]=a,a=0,h=7):h--;if(i==c.length)break}return c.length!=i?new Uint8Array(c.buffer,0,i):c};